How to add index weight on two id fields on MongoDB?<p>I have a question regarding Mongo indexes for a <code>$or</code> request on two ObjectID fields.</p>
<p>How can I make sure a search will first look at the first argument of the <code>$or</code> expression and only then if no match looks at the second or should we split it into two requests and add this logic in our code?</p>
<p>I tried to use a compound index with weights but it's only working for text search.</p>
<p>Here is what I've tried :</p>
<pre class="lang-js prettyprint-override"><code>@index({ user_id: 1 }, { unique: true, partialFilterExpression: { user_id: { $exists: true } } })
@index({ device_id: 1 }, { partialFilterExpression: { device_id: { $exists: true } } })
@index(
  { user_id: 1, device_id: 1 },
  {
    weights: {
      user_id: 10,
    },
    partialFilterExpression: { user_id: { $exists: true }, device_id: { $exists: true } },
  },
)
@modelOptions({
  schemaOptions: {
    collection: 'test',
    timestamps: {
      createdAt: 'created_at',
      updatedAt: 'updated_at',
    },
  },
})
export class Test extends Base {
  @prop({ required: false })
  public user_id?: ObjectId

  @prop({ required: false })
  public device_id?: ObjectId
}
</code></pre>
<p>The request I'm trying :</p>
<pre class="lang-js prettyprint-override"><code>db.test.find( { $or: [ { user_id: ObjectId('624c6bada5b7f846e80af8cb')}, { device_id: ObjectId('624c6bada5b7f846e80af8ca')}]} )
</code></pre>
<p>The results :
<a href="https://i.stack.imgur.com/rx3kT.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/rx3kT.png" alt="enter image description here" /></a></p>
<p>The indexes :</p>
<p><a href="https://i.stack.imgur.com/YAvjv.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/YAvjv.png" alt="enter image description here" /></a></p>
<p>Thank you!</p>

