How to populate data from another collections in mongoose?<p>I want to populate the busNumber from bus Bus table to the trip table.
Here's the bus model</p>
<pre><code>const busSchema = new mongoose.Schema(
  {
    busNumber: {
      type: String,
      unique: true,
      required: true,
    },
    seats: {
      type: Number,
    },
  },
  {
    timestamps: true,
  }
);
</code></pre>
<p>now I want to show the bus number inside the trip table instead of bus._id. I know how to exclude data but don't know how to include data from other collections.
here's the route model where I included the bus model</p>
<pre><code>const routeSchema = new mongoose.Schema({
  location:{
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Location',
    required: true
  },
  duration: {
    type: Number,
    required: true,
  },
  Bus:{
    type: mongoose.Schema.Types.ObjectId,
    ref:&quot;Bus&quot;,
    required: true
  },
  date: {
    type:String,
    required: true
  },
},
{
  timestamps: true,
});
</code></pre>
<p>here's the query:</p>
<pre><code>router.get(&quot;/trips&quot;, async (req, res) =&gt; {
  if ((!req.query.departure &amp;&amp; !req.query.arrival) || !req.query.date) {
    return res.send({
      error: &quot;Please enter the data to get the trip&quot;,
    });
  }
  const { departure, arrival, date } = req.query;

  const locations = await Location.find({
    &quot;departureLocation.name&quot;: departure,
    &quot;arrivalLocation.name&quot;: arrival,
  });

  const ids = locations.map(location =&gt; location._id);
  const routes = await Route.find({
    $and: [{ location: { $in: ids } }, { date }],
  }).select(['-busId', '-location', '-_id', '-createdAt', '-updatedAt', '-__v']);

  return !routes ? res.status(404).send() : res.status(200).send(routes);
});
</code></pre>
<p>Here's the result I am getting <a href="https://i.stack.imgur.com/AwK5N.png" rel="nofollow noreferrer">https://i.stack.imgur.com/AwK5N.png</a></p>
<p>How to use the populate() function to get data from another collection in mongoose</p>

