How can I get specific field value with array nested filter in MongoDB?<p>After I filtered nested array values then I added &quot;$project&quot; query for selecting specific fields.</p>
<p>I want to get &quot;new_yn&quot; field values outside of the nested array but I only got id and nested array values.</p>
<p>How can I fix my Query? Would you give me some guides?
(MongoDB version is 5.0.6 Community)</p>
<p><strong>[Query]</strong></p>
<pre><code>db.collection.aggregate([
  {
    $match: {
      &quot;new_yn&quot;: &quot;Y&quot;,
      &quot;port_info&quot;: {
        $elemMatch: {
          &quot;port_code&quot;: &quot;http_https&quot;
        }
      }
    }
  },
  {
    $project: {
      port_info: {
        $filter: {
          input: &quot;$port_info&quot;,
          as: &quot;item&quot;,
          cond: {
            $eq: [
              &quot;$$item.port_code&quot;,
              &quot;http_https&quot;
            ]
          }
        }
      }
    }
  },
  {
    &quot;$project&quot;: {
      &quot;_id&quot;: 1,
      &quot;new_yn&quot;: 1,
      &quot;port_info.ip_port&quot;: 1
    }
  }
])
</code></pre>
