Update collection to change the rank<p>i have a mongodb collection that I sort by the amount of points each item has, and it shows a rank according to it's place in the collection :</p>
<pre><code>db.collection('websites').find({}).sort({  &quot;points&quot;: -1 }).forEach(doc =&gt; {

  rank++;
  doc.rank = rank;
  delete doc._id;
  console.log(doc)
</code></pre>
<p><a href="https://i.stack.imgur.com/ed25g.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/ed25g.png" alt="enter image description here" /></a></p>
<p>Si I thought to myself : <strong>Ok, I'm gonna update the rank in the collection</strong>, so I added this :</p>
<pre><code> db.collection('websites').updateMany({},
    { $set: { rank: doc.rank } }
)
</code></pre>
<p>But I was too good to be true, and it updates every single item with the same rank, which changes at each refresh, what exactly is going on, here ?</p>
<p><a href="https://i.stack.imgur.com/0kZee.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/0kZee.png" alt="enter image description here" /></a>
<a href="https://i.stack.imgur.com/Qcg09.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/Qcg09.png" alt="enter image description here" /></a></p>
<p><strong>EDIT : I managed to do it by doing this :</strong></p>
<pre><code>rank = 0;

db.collection('websites').find({}).sort({  &quot;points&quot;: -1 }).forEach(doc =&gt; {

  rank++;
  doc.rank = rank;
  //delete doc._id;
  console.log(doc._id);

  db.collection('websites').updateMany({_id : doc._id},
    { $set: { rank: doc.rank } },
    { upsert: true }
)

})
</code></pre>

